import React from "react";

const Match = (props) => {
    return(
        <div className="card">
            <div className="Match-Flag1"> <img src={props.attributes.image_url1} alt={props.attributes.name}/> </div>
            <div className="Match-Flag2"> <img src={props.attributes.image_url2} alt={props.attributes.name}/> </div>
            <div className="Match-name">{props.attributes.name}</div>
            <div className="Match-score"></div>
            <div className="Match-link"></div>
        </div>
    )
}
